function bubbleSort(&$list)
{
    $array_size = sizeof($list);
    $start = microtime();
    for ($i=0; $i < $array_size; $i++) {
        for ($j=0; $j < ($array_size - $i - 1); $j++) {
            if ($list[$j] > $list[$j+1]) {
                $t = $list[$j];
                $list[$j] = $list[$j+1];
                $list[$j+1] = $t;
            }
        }
    }
    $end = microtime();

    echo $end - $start;
}
